0=Tour 03-1@Operation: Secure the Retreat@Location: South of Nica, 
1=Latvia@--------------------------------------------------@@The Soviet 
2=invasion has caught several Allied commanders by surprise. Several 
3=armies have been routed and more are attempting to retreat to more 
4=defensive positions. @@One such unit is moving valuable research and 
5=infantry equipment away from vulnerable areas to prevent them from 
6=falling in the hands of the Soviets. @@You have been requested to 
7=assist in covering their retreat. A base of operations will be 
8=provided upon your arrival. @@The supply column consists of 5 groups 
9=of 6 trucks each. Do not let too many of them fall to the hands of 
10=the Soviets! 

